                source: '钱博士英语',
                word: 'silhouette',
                value:
                  "英语单词silhouette（剪影）来自18世纪法国财务大臣Etienne de Silhouette的名字。在他担任财务大臣时，法国因为“七年战争”而陷入财务危机。他上任后厉行节俭政策，禁止铺张奢华，因此遭到很多人尤其是有钱人的憎恶。为了嘲笑他，人们把他的名字当成了各种便宜货的代名词。当时在法国出现了一种便宜的肖像方法，即在纸上剪出人物的外部轮廓。与常规的肖像画相比，这种剪影方式非常便宜。人们便沿用一贯的恶搞，将其称呼为silhouette。没想到后来这个词竟然长盛不衰，正式成为了表示“剪影”的名词。\n silhouette：[,sɪlʊ'et] n.剪影，轮廓",
